export const gradeAction = (data) => {
  return { type: 'GRADE_INPUT', payload: data };
};
export const yearAction = (data) => {
  return { type: 'YEAR_INPUT', payload: data };
};
export const lessonAction = (data) => {
  return { type: 'LESSON_INPUT', payload: data };
};
export const studentIdAction = (data) => {
  return { type: 'STUDENT_ID_INPUT', payload: data };
};
